UPDATE K_CONTAS SET
    MOEDA = 'BRL',
    FLUXODECAIXA = 'N',
    EXTRATOBANCARIO = 'N',
    USACOMPRAS = 'N',
    USAVENDAS = 'N',
    USACONTASAPAGAR = 'N',
    USACONTASARECEBER = 'N',
    DATAATUALIZACAO = '2016-01-01'
WHERE MOEDA IS NULL;

-- seta relatórios de fluxo de caixa para todas as receitas e despesas
UPDATE K_CONTAS SET FLUXODECAIXA = 'S' WHERE (CODIGO LIKE '4%' OR CODIGO LIKE '5%') AND NIVEL = 3;

-- seta relatórios de extrato bancário para todos os bancos
UPDATE K_CONTAS SET EXTRATOBANCARIO = 'S', USACOMPRAS = 'S', USAVENDAS = 'S'
WHERE CODIGO LIKE '1.02%' AND NIVEL = 3;

-- planos comuns de compras e vendas (ativo circulante)
UPDATE K_CONTAS SET USACOMPRAS = 'S', USAVENDAS = 'S'
WHERE CODIGO LIKE '1.01%' AND NIVEL = 3;

-- e estes planos são específicos para os lançamentos de compras e vendas, respectivamente.
UPDATE K_CONTAS SET USACOMPRAS = 'S'
WHERE (CODIGO LIKE '2%' AND NIVEL = 3) OR NOME = 'Fornecedores';

UPDATE K_CONTAS SET USAVENDAS = 'S' WHERE NOME = 'Vendas';

